import { 
  NEW_NOTE
} from '../actions/notes';

const initialState = {
  notes: [{ id:0, title: "First Note", content: "Hello World"}],
  openNote: null,
  isEditing: false
}

export function notes(state = initialState, action) {
  switch (action.type) {
    case NEW_NOTE:
      return [ ...state, action.note ];
    default: return state
  }
}
